}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <h2 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h2>
    <p>{`The .NET Community has built many `}<a parentName="p" {...{
        "href": "https://redis.io/clients#c-sharp"
      }}>{`client libraries`}</a>{` to help handle requests to Redis Server. In this guide, we'll mostly be concerned with using the `}<a parentName="p" {...{
        "href": "https://github.com/StackExchange/StackExchange.Redis"
      }}>{`StackExchange.Redis`}</a>{` client library. As the name implies the StackExchange client is developed by StackExchange for use on popular websites like `}<a parentName="p" {...{
        "href": "https://stackoverflow.com/"
      }}>{`StackOverflow`}</a>{`.`}</p>
    <h2 {...{
      "id": "step-1-install-the-package"
    }}>{`Step 1. Install the Package`}</h2>
    <p>{`There are a few ways to Install the Package:`}</p>
    <Tabs defaultValue="cli" values={[{
      label: '.NET CLI',
      value: 'cli'
    }, {
      label: 'PM Console',
      value: 'pmConsole'
    }, {
      label: 'Package Reference',
      value: 'csproj'
    }, {
      label: 'NuGet GUI',
      value: 'gui'
    }]} mdxType="Tabs">
  <TabItem value="cli" mdxType="TabItem">
        <p>{`Run the following in the directory of the `}<inlineCode parentName="p">{`csproj`}</inlineCode>{` file you want to add the package too.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`  dotnet add package StackExchange.Redis
`}</code></pre>
  </TabItem>
  <TabItem value="pmConsole" mdxType="TabItem">
        <p>{`  Run the following command from the Package Manager Console`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-sh"
          }}>{`Install-Package StackExchange.Redis
`}</code></pre>
  </TabItem>
  <TabItem value="csproj" mdxType="TabItem">
        <p>{`  You can also add the package directly to you `}<inlineCode parentName="p">{`csproj`}</inlineCode>{` file with the following XML:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-XML"
          }}>{`<ItemGroup>    
  <PackageReference Include="StackExchange.Redis" Version="2.2.4" />
</ItemGroup>
`}</code></pre>
  </TabItem>
  <TabItem value="gui" mdxType="TabItem">
        <p>{`  If you're using Visual Studio, and you want to use the NuGet GUI just follow the steps outlined by `}<a parentName="p" {...{
            "href": "https://docs.microsoft.com/en-us/nuget/consume-packages/install-use-packages-visual-studio"
          }}>{`Microsoft`}</a>{`, and make sure to search for `}<strong parentName="p">{`StackExchange.Redis`}</strong></p>
  </TabItem>
    </Tabs>
    <h2 {...{
      "id": "step-2-import-the-required-namespace"
    }}>{`Step 2. Import the Required Namespace`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-csharp"
      }}>{`using StackExchange.Redis;
`}</code></pre>
    <h2 {...{
      "id": "step-3-initialize-the-connectionmultiplexer"
    }}>{`Step 3. Initialize the ConnectionMultiplexer`}</h2>
    <p>{`The `}<a parentName="p" {...{
        "href": "https://stackexchange.github.io/StackExchange.Redis/Basics"
      }}>{`ConnectionMultiplexer`}</a>{` is the main arbiter of the connection to Redis inside the CLR, your application should maintain a single instance of the ConnectionMultiplexer throughout its runtime. You can initialize the Multiplexer with either a connection string, or with a `}<inlineCode parentName="p">{`ConfigurationOptions`}</inlineCode>{` object. A typical connection string is of the form: `}<inlineCode parentName="p">{`HOST_NAME:PORT_NUMBER,password=PASSWORD`}</inlineCode>{` where `}<inlineCode parentName="p">{`HOST_NAME`}</inlineCode>{` is the host name of your server (e.g. `}<inlineCode parentName="p">{`localhost`}</inlineCode>{`), `}<inlineCode parentName="p">{`PORT_NUMBER`}</inlineCode>{` is the port number Redis is listening on (e.g. `}<inlineCode parentName="p">{`6379`}</inlineCode>{`) and `}<inlineCode parentName="p">{`PASSWORD`}</inlineCode>{` is your redis server's password (e.g. `}<inlineCode parentName="p">{`secret_password`}</inlineCode>{`).`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-csharp"
      }}>{`static readonly ConnectionMultiplexer _redis = ConnectionMultiplexer.Connect($"{HOST_NAME}:{PORT_NUMBER},password={PASSWORD}");
`}</code></pre>
    <h2 {...{
      "id": "step-4-grab-database-connection"
    }}>{`Step 4. Grab Database Connection`}</h2>
    <p>{`Once we have a handle for the Multiplexer, we need get a connection to the database.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-csharp"
      }}>{`var db = _redis.GetDatabase();
`}</code></pre>
    <h2 {...{
      "id": "step-5-use-the-connection"
    }}>{`Step 5. Use the connection`}</h2>
    <p>{`Now that you've retreived the connection to the database, all that's left is to use it. Here are some simple operations:`}</p>
    <Tabs defaultValue="ping" values={[{
      label: 'Ping the Database',
      'value': 'ping'
    }, {
      label: 'Set and Get String',
      value: 'strings'
    }, {
      label: 'List Operations',
      value: 'lists'
    }, {
      label: 'Set Operations',
      value: 'sets'
    }, {
      label: 'Hash Operations',
      value: 'hashes'
    }]} mdxType="Tabs">  
  <TabItem value='ping' mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`db.Ping();
`}</code></pre>
  </TabItem>
  <TabItem value='strings' mdxType="TabItem">
        <h3 {...{
          "id": "set-string"
        }}>{`Set String`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`db.StringGetSet("foo","bar");
`}</code></pre>
        <h3 {...{
          "id": "get-string"
        }}>{`Get String`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`Console.WriteLine(db.StringGet("foo"));
`}</code></pre>
  </TabItem>
  <TabItem value="lists" mdxType="TabItem">
        <h3 {...{
          "id": "insert-into-list"
        }}>{`Insert Into List`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`db.ListLeftPush("simple-list", 1);
`}</code></pre>
        <h3 {...{
          "id": "pop-out-of-list"
        }}>{`Pop Out of List`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`var result = db.ListRightPop("simple-list");
Console.WriteLine(result);
`}</code></pre>
  </TabItem>
  <TabItem value="sets" mdxType="TabItem">
        <h3 {...{
          "id": "insert-into-set"
        }}>{`Insert Into Set`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`db.SetAdd("sample-set-1", new RedisValue[]{"apple", "banana", "tangerine", "kiwi"});
db.SetAdd("sample-set-2", new RedisValue[]{"apple", "banana", "orange", "blueberries"});
`}</code></pre>
        <h3 {...{
          "id": "set-union"
        }}>{`Set Union`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`var union = db.SetCombine(SetOperation.Union, "sample-set-1", "sample-set-2");
Console.WriteLine(String.Join(", ", union));
`}</code></pre>
        <h3 {...{
          "id": "set-intersection"
        }}>{`Set Intersection`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`var intersection = db.SetCombine(SetOperation.Intersect, "sample-set-1", "sample-set-2");
Console.WriteLine(String.Join(", ", intersection));
`}</code></pre>
        <h3 {...{
          "id": "set-difference"
        }}>{`Set Difference`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`var difference = db.SetCombine(SetOperation.Difference, "sample-set-1", "sample-set-2");
Console.WriteLine(String.Join(", ",difference));
`}</code></pre>
  </TabItem>
  <TabItem value="hashes" mdxType="TabItem">
        <h3 {...{
          "id": "add-to-hash"
        }}>{`Add to Hash`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`db.HashSet("person:1", new HashEntry[]{new HashEntry("first-name","John"), new HashEntry("last-name","Smith")});
`}</code></pre>
        <h3 {...{
          "id": "get-field-from-hash"
        }}>{`Get Field From Hash`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`var firstName = db.HashGet("person:1", "first-name");
Console.WriteLine(firstName);
`}</code></pre>
        <h3 {...{
          "id": "get-all-fields-from-hash"
        }}>{`Get All Fields From Hash`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-csharp"
          }}>{`var allFields = db.HashGetAll("person:1");
Console.WriteLine(string.Join(", ",allFields));
`}</code></pre>
  </TabItem>
    </Tabs>
    <h2 {...{
      "id": "redis-launchpad"
    }}>{`Redis Launchpad`}</h2>
    <p>{`Redis Launchpad is like an “App Store” for Redis sample apps. You can easily find apps for your preferred frameworks and languages.
Below are few of these apps. `}<a parentName="p" {...{
        "href": "https://launchpad.redislabs.com"
      }}>{`Click here to access the complete lists of apps`}</a></p>
    <div class="row text--center">
      <div class="col ">
        <div className="ri-container">
          <h4 {...{
            "id": "rate-limiting-app-in-net"
          }}>{`Rate Limiting App in .NET`}</h4>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-redis-rate-limiting-demo-csharp-dot-net"
            }}><img alt={"Launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/rate-limiting.png").default} /></a></p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "leaderboard-app-in-net"
          }}>{`Leaderboard App in .NET`}</h4>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-redis-leaderboard-demo-dotnet"
            }}><img alt={"Launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/leaderboard.png").default} /></a></p>
        </div>
      </div>
    </div>
    <div class="row text--center">
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "api-caching-net"
          }}>{`API Caching .NET`}</h4>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-caching-demo-csharpdotnet"
            }}><img alt={"Launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/cachingMarketplace.png").default} /></a></p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "basic-chat-app-net"
          }}>{`Basic Chat App .NET`}</h4>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-redis-chat-app-demo-dotnet"
            }}><img alt={"Launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/chatMarketplace.png").default} /></a></p>
        </div>
      </div>
    </div>
    <h4 {...{
      "id": "additional-resources"
    }}>{`Additional Resources`}</h4>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://docs.redislabs.com/latest/rs/references/client_references/client_csharp/"
        }}>{`Using C# with Redis`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://docs.redislabs.com/latest/rs/references/client_references/client_csharp/"
        }}>{`Using SSL and StackExchange.Redis`}</a></li>
    </ul>
    </MDXLayout>;
}

;
